/*!

* Copyright 2019 Symto Inc.

*/
import React from 'react';
import { Link } from 'react-router-dom';
// reactstrap components
import {
	Collapse,
	NavbarBrand,
	Navbar,
	NavItem,
	NavLink,
	Nav,
	Container,
	Row,
	Col,
} from 'reactstrap';

class PagesNavbar extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			collapseOpen: false,
			color: 'navbar-transparent',
		};
	}
	componentDidMount() {
		window.addEventListener('scroll', this.changeColor);
	}
	componentWillUnmount() {
		window.removeEventListener('scroll', this.changeColor);
	}
	changeColor = () => {
		if (
			document.documentElement.scrollTop > 99 ||
			document.body.scrollTop > 99
		) {
			this.setState({
				color: 'bg-white',
			});
		} else if (
			document.documentElement.scrollTop < 100 ||
			document.body.scrollTop < 100
		) {
			this.setState({
				color: 'navbar-transparent',
			});
		}
	};
	toggleCollapse = () => {
		document.documentElement.classList.toggle('nav-open');
		this.setState({
			collapseOpen: !this.state.collapseOpen,
		});
	};
	onCollapseExiting = () => {
		this.setState({
			collapseOut: 'collapsing-out',
		});
	};
	onCollapseExited = () => {
		this.setState({
			collapseOut: '',
		});
	};
	render() {
		return (
			<Navbar
				className={'fixed-top ' + this.state.color}
				color-on-scroll='100'
				expand='lg'
			>
				<Container>
					<div className='navbar-translate'>
						<NavbarBrand
							data-placement='bottom'
							to='/home'
							rel='noopener noreferrer'
							title='Symto - Be Well!'
							tag={Link}
						>
							<span>Symto• </span>
							Be Well
						</NavbarBrand>
						<button
							aria-expanded={this.state.collapseOpen}
							className='navbar-toggler navbar-toggler'
							onClick={this.toggleCollapse}
						>
							<span className='navbar-toggler-bar bar1' />
							<span className='navbar-toggler-bar bar2' />
							<span className='navbar-toggler-bar bar3' />
						</button>
					</div>
					<Collapse
						className={
							'justify-content-end ' + this.state.collapseOut
						}
						navbar
						isOpen={this.state.collapseOpen}
						onExiting={this.onCollapseExiting}
						onExited={this.onCollapseExited}
					>
						<div className='navbar-collapse-header'>
							<Row>
								<Col className='collapse-brand' xs='6'>
									<a
										href='#pablo'
										onClick={(e) => e.preventDefault()}
									>
										Symto
									</a>
								</Col>
								<Col
									className='collapse-close text-right'
									xs='6'
								>
									<button
										aria-expanded={this.state.collapseOpen}
										className='navbar-toggler'
										onClick={this.toggleCollapse}
									>
										<i className='tim-icons icon-simple-remove' />
									</button>
								</Col>
							</Row>
						</div>
						<Nav navbar>
							<NavItem className='p-0'>
								<NavLink
									data-placement='bottom'
									href='https://www.facebook.com/Symto.net/'
									rel='noopener noreferrer'
									target='_blank'
									title='Like us on Facebook'
								>
									<i className='fab fa-facebook-square' />
									<p className='d-lg-none d-xl-none'>
										Facebook
									</p>
								</NavLink>
							</NavItem>
							<NavItem className='p-0'>
								<NavLink
									data-placement='bottom'
									href='https://www.instagram.com/symto.insta'
									rel='noopener noreferrer'
									target='_blank'
									title='Follow us on Instagram'
								>
									<i className='fab fa-instagram' />
									<p className='d-lg-none d-xl-none'>
										Instagram
									</p>
								</NavLink>
							</NavItem>
							<NavItem className='p-0'>
								<NavLink
									data-placement='bottom'
									href='https://www.pinterest.com/symto_pins/'
									rel='noopener noreferrer'
									target='_blank'
									title='Follow our Pinterest Boards'
								>
									<i className='fab fa-pinterest' />
									<p className='d-lg-none d-xl-none'>
										Pinterest
									</p>
								</NavLink>
							</NavItem>
							{/* FAQ Page */}
							<NavItem className='p-0'>
								<NavLink to='/' tag={Link}>
									FAQ
								</NavLink>
							</NavItem>
						</Nav>
					</Collapse>
				</Container>
			</Navbar>
		);
	}
}

export default PagesNavbar;
